import React from 'react'

const FlightChart = () => {
    return (
        <div className="flightChart">
            <h4>Name</h4>
            <h4>Origin</h4>
            <h4>Origin Date</h4>
            <h4>Destination</h4>
            <h4>Destination Date</h4>
        </div>
    )
}

export default FlightChart
